    const [phone, setPhone] = useState('Phone')
    const [adress, setAdress] = useState('Adress')
    const onNameChanged = e => setTitle(e.target.value)
    const onEmailChanged = e => setTitle(e.target.value)
    const onPhoneChanged = e => setTitle(e.target.value)
    const onAdresshanged = e => setTitle(e.target.value)

  return (

    <section>
        <form>
                <label htmlFor="name">Name:</label>
                <input
                    type="text"
                    id="name"
                    name="name"
                    value={name}
                    onChange={onNameChanged}
                />
                <label htmlFor="email">Email:</label>
                <input
                    type="text"
                    id="email"
                    name="email"
                    value={email}
                    onChange={onEmailChanged}
                />
                <label htmlFor="phone">Phone:</label>
                <input
                    type="text"
                    id="phone"
                    name="phone"
                    value={phone}
                    onChange={onPhoneChanged}
                />
                <label htmlFor="adress">Adress:</label>
                <input
                    type="text"
                    id="adress"
                    name="adress"
                    value={adress}
                    onChange={onAdressChanged}
                />
        </form>
    </section>
  )
}
